(115, '19866b65a348b1c7991722788a09e3c8.png', '0bd914b72f89d3ba0933063b3ed920d2.', '7a562cf22a5312dacceeb20d7451714d.', 'aaebe82690d3bc8930ded9c64c56e6d6.', 'Gravier 5/15', 'Le gravier est un granulat composé d&#039;un mélange de sable et de gravillons. Les graviers peuvent être naturels, reconstitués en centrale, traités aux liants hydrauliques (ciment, laitier…), à la chaux, ou aux liants hydrocarbonés (bitume). Le 5/15 sert à faire le béton de fondation , poteaux en élévation, poutres et plancher ', 7000, 20, 1, 37, '5/15', 0, '2023-10-05 10:47:38'),
(116, '6f2816f20aa37d83fac0124756fc30ee.jfif', '733ffbb7eefaa8f0ca0a9e8f62e3545e.', '177a4e7ed115a6b5ed5b5775bc1368d5.', '90d40377c61403acdbfc04a755abed36.', 'Gravier 15/25', 'Le gravier est un granulat composé d&#039;un mélange de sable et de gravillons. Les graviers peuvent être naturels, reconstitués en centrale, traités aux liants hydrauliques (ciment, laitier…), à la chaux, ou aux liants hydrocarbonés (bitume).le 15/25 SERT À FAIRE LE BETON DE VOILE DE SOUTÈNEMENT, BETON D&#039;OUVRAGE D&#039;ART ET D&#039;ASSAINISSEMENT ', 7000, 20, 1, 2, '15/25', 0, '2023-10-05 10:51:12'),
(118, '618152f8d05cd5c5e9339660f70b6d21.jfif', '7d56f35049804f1803702315595d78cb.', 'a355d4cf2edc771e6fd9abae74fee78c.', 'e935f6931f01cb6a4bba2a7d32cbc22b.', 'Gravier 5/25', 'Le gravier est un granulat composé d&#039;un mélange de sable et de gravillons. Les graviers peuvent être naturels, reconstitués en centrale, traités aux liants hydrauliques (ciment, laitier…), à la chaux, ou aux liants hydrocarbonés (bitume).IL SERT AUX OUVRAGES À FORTE SOLLICITATION ', 7000, 20, 1, 2, '5/25', 0, '2023-10-05 10:54:20'),
(129, '83f0d4391e19e3fd45d7548405247e7e.png', 'aeaa0032d9d6b5d146bcd95e2f6cf53a.', 'e9152b1a6d65cc2f8927b85cd0fc1bcd.', '606c086448d11a9d6a176504059c1f6d.', 'Ciment EXTRA', 'Ciment Bélier est la marque phare de LafargeHolcim Côte d’Ivoire. Créé en 1952, Ciment Bélier a su évoluer au fil des années pour s’adapter aux besoins des clients.\r\n\r\nLa gamme comprend aujourd’hui 2 gammes de produits conditionnés en sacs et en vrac.\r\n\r\n3 lignes de produits qui peuvent être livrés en sacs de 50 kg et 40kg (SuperBric) :\r\n\r\nClassic : le CPJ 32,5 usage pour travaux courants ;\r\n\r\nSuperBric : CPA 52,5 dédié à la fabrication de briques et préfabriqués ;\r\n\r\nExtra : CPJ 42,5 recommandé pour les préfabrications et dalles.', 90000, 2, 2, 135, '50kg', 0, '2023-10-10 12:54:43'),
(132, '90b82ac17ead1ed6f008486d24e02c32.jpg', 'fbe2cc670dbacdc6e38273445b8cb7dd.', 'ea7a6ee8601cb509f3297f8dcdcb1f08.', '53415e992778fd5e07ffb1d20d49d2d4.', 'Briques creuse', 'Aggloméré creux à base de gravillons et de ciment.\r\n\r\néps: 15cm\r\n\r\nDim: 20x40\r\n\r\nCommercialisation: par unité\r\n\r\n', 390, 10, 3, 8, '15cm', 0, '2023-04-26 11:10:13'),
