(136, '6726d896b54846cb0d22060612ffdd44.png', '76a0b9ebf3bf725f7c2c1a113841707c.', '27ce81926da18a0dffaa2f83180a0605.', '6631918147f51cee82143f6034fc5fd1.', 'Briques pleine', 'Aggloméré plein à base de gravillons et de ciment.\r\n\r\néps: 15cm\r\n\r\nDim: 20x40\r\n\r\nCommercialisation: par unité', 530, 10, 3, 80, '15cm', 0, '2023-04-26 11:15:59'),
(137, 'da8bc886de4c5ea755a5360014a689b1.png', '1c751209e64ace2f8f151615e5954c40.', '3465a49bd9b25470b7dfed88ea519718.', 'ab5814ddb7450f41596a41ce4843d2af.', 'Hourdis Français', 'Hourdis Français à base de gravillons et de ciment.\r\n\r\néps: 15cm\r\n\r\nDim: 20x53\r\n\r\nCommercialisation: par unité', 530, 10, 3, 7, '15cm', 0, '2023-04-26 11:17:14'),
(138, '21be451eafa899e4652659f4b636ae69.jpg', '88a013a9706f072bb6713215ba89740f.', 'ff621b540f078c24dd49d513f2e6daa3.', '701dc95e236184bbe0ccf01fbbf14d1a.', 'Pointes Ordinaire ', 'La pointe ordinaire de marque TIM tête plate est fabriquée par frappe à froid, à partir de fil tréfilé clair et Trempée sous contrôle qualité strict. Associant une grande dureté à un angle de rupture idéal pour une sécurité d&#039;utilisation. Ces clous sont pour les travaux de finition, agencement, décoration, encadrement, meuble, menuiserie fine, assemblage.. doux pour bois. Ce sont des clous de haute performance. Sa surface est plus lisse et plus résistante à la corrosion.', 1500, 10, 4, 123, 'N°8', 0, '2023-10-13 11:16:57'),
(203, 'd370a5ccfdeba3a3a7582fe16c36a9cf.png', 'd7b9b3b2eef43d9bf166016bb07a3a48.', 'cf570ee9243724e3d9ddcf61aa1363ca.', '4f9a16decd9563974c3676e3e5af1e92.', 'PAVÉ SIMPLE', 'Fabriqué a base de ciment, de graviers, de sable et d&#039;eau, les pavés en béton classique sont les plus utilisés en termes de revêtement de sol pour les allées et les routes. Avec une  pose assez simple, elle ne nécessite pas beaucoup de matériel mise à part l’ajout d’un mortier de scellement de qualité. Offrant des caractéristiques souvent personnalisées, ces pavés peuvent être teinté dans la masse ou partiellement pour être des paves décoratifs et aussi des autobloquants carrossables ou non carrossables. Les pavages, pavés et dallages en béton décoratif sont reconnus comme des produits particulièrement  résistants et adaptables à tous les concepts actuels de réalisations. Fabriqués 100 % localement, à froid et séchés à l’air naturel dans des sites dédiés, les produits en béton décoratif sont entièrement recyclable et sont en phase avec les critères de préservation de l’environnement. Elles sont donc écologique.\r\n\r\nVous trouverez une gamme variée de pavés personnalisés selon le champs d&#039;application ', 8500, 10, 3, 97, 'E 8', 0, '2023-12-11 10:45:41'),
(204, 'a00e12c2c02cd3205e1a210bc6987e01.png', '7045343b0d987bfb7a9b8d45e7b09fac.', 'd5478a23b1a3e3031e03f3ba82f2d43c.', '260a83068a522bab50282ef043932481.', 'Pavés H', 'Fabriqué a base de ciment, de graviers, de sable, d&#039;eau et de teinte, les pavés en béton H ou I sont les plus utilisés en termes de revêtement de sol pour les allées et les routes. Avec une  pose assez simple consistant a l&#039;emboitement, elle ne nécessite pas beaucoup de matériel mise à part l’ajout d’un mortier de scellement de qualité. Offrant des caractéristiques souvent personnalisées, ces pavés peuvent être des autobloquants carrossables ou non carrossables. Les pavages, pavés et dallages en béton décoratif sont reconnus comme des produits particulièrement  résistants et adaptables à tous les concepts actuels de réalisations. Fabriqués 100 % localement, à froid et séchés à l’air naturel dans des sites dédiés, les produits en béton décoratif sont entièrement recyclable et sont en phase avec les critères de préservation de l’environnement.\r\n\r\nVous trouverez une gamme variée de pavés personnalisés selon le champs d&#039;application ', 70000, 10, 3, 97, '5mm', 0, '2023-04-26 17:14:20'),
(205, '18d31ef12686ce5d3553ec7ed373fdc0.png', '790b77aece9fd015f407c7fd09051047.', '9bd0a272db18f5ef41c374f2a792a14c.', '74d6eeb4d5213b99f7a523b350287824.', 'Pavés H ou I décoratif', 'Fabriqué a base de ciment, de graviers, de sable, d&#039;eau et de teinte, les pavés en béton H ou I sont les plus utilisés en termes de revêtement de sol pour les allées et les routes. Avec une  pose assez simple consistant a l&#039;emboitement, elle ne nécessite pas beaucoup de matériel mise à part l’ajout d’un mortier de scellement de qualité. Offrant des caractéristiques souvent personnalisées, ces pavés peuvent être des autobloquants carrossables ou non carrossables. Les pavages, pavés et dallages en béton décoratif sont reconnus comme des produits particulièrement  résistants et adaptables à tous les concepts actuels de réalisations. Fabriqués 100 % localement, à froid et séchés à l’air naturel dans des sites dédiés, les produits en béton décoratif sont entièrement recyclable et sont en phase avec les critères de préservation de l’environnement.\r\n\r\nVous trouverez une gamme variée de pavés personnalisés selon le champs d&#039;application ', 6000, 10, 3, 97, '12mm', 0, '2023-04-26 17:25:34'),
(321, '33d6c8db5e2213b77b5210073c84c412.png', '238f8176a8f3751e87ff9c27951374da.', 'b45261f4895460c7c3a7be1b42aaae88.', '8042ee02d96f9b6a9a68a439f1d817e6.', 'Armature', 'Assemblage, en général métallique, destiné à maintenir ensemble, à renforcer ou à soutenir les différentes parties d&#039;un tout : L&#039;armature d&#039;un abat-jour.', 8000, 10, 4, 123, 'le Metre', 0, '2023-10-13 11:04:27'),
