(330, '71373cc302cf08525105fb3c22713b06.png', '06e9e19f0bb237f00f3684600879398a.', 'e6fe933ab00c01e090cafe9ed51898bb.', '61ac66dadab2db1d74c96b62c5a92a4e.', 'fil de fer', 'Pièce métallique de forme cylindrique, de faible section et résistant à la tension. Le fil de fer est obtenu par un étirage en longueur. Exemple : Le terrain militaire était délimité par du fil de fer barbelé.', 8000, 10, 4, 123, '1.1m', 0, '2023-10-13 10:27:52'),
(334, '0336cf019eeef856557c44650100c890.jpg', 'bb75a4f9c339923b4b9714ea9ae0ea1c.', '3e8330037f431710fc3698ab04ab598e.', 'c8bfafe21249c3c273cd94de48882494.', 'pointe N°12', 'Pièce métallique de forme cylindrique, de faible section et résistant à la tension. Le fil de fer est obtenu par un étirage en longueur. Exemple : Le terrain militaire était délimité par du fil de fer barbelé.', 3800, 10, 4, 123, 'N°12', 0, '2023-10-13 10:27:52'),
