(418, '47f46f42b477fc4736d6cf802887dbd8.jpg', '214f93457f277b8eeb6e2531180504ee.', 'a0297b45a2cdc6952597f5ddfe9727d6.', '7a44cbd1a83eb53d47f1816cf1319990.', 'Réchaud à Gaz portable', 'Un réchaud gaz est une plaque de cuisson d&#039;appoint qui fonctionne au gaz. Ce outil de chauffe est le plus léger et compact sur le marché. Il peut être utilisé en cuisine, en nature, sur un bateau ou même en camping. Il est destiné à chauffer ou réchauffer des aliments', 6500, 1, 14, 112, '0.9 kg', 0, '2023-05-25 14:33:31'),
(427, '9d6283aaba0a15d21cc4575300dd73dd.jpg', '3a0c9a25fa9d4f7c3a1005667ce24170.', '8be2a7ab03b2d3f72bab73a36a26501c.', '32ac087ea7f8583b04161b5a420b4aa7.', 'tenaille', 'Outil formé de deux branches croisées et articulées autour d&#039;un axe, terminées par des mors qu&#039;on peut rapprocher pour saisir, serrer ou couper certains objets. 2. Élément extérieur de la fortification bastionnée, couvrant la courtine.', 10000, 10, 14, 112, '20mm', 0, '2023-05-25 12:42:58'),
