(505, '7a812638fb91056671a08ca27433b852.jpg', '8d584dda4b4bdd680e330c578450fda0.', '57149032e0384073f7964c00b4415278.', 'f36233fcc39b1e9a35697bfeafd2704e.', 'ODOMÈTRE 32 GWM', 'FACILE À UTILISER : poignée revolver ergonomique et structure légère en aluminium\r\nMANCHE TÉLESCOPIQUE : son manche télescopique avec réglage de la hauteur en continu assure souplesse d’utilisation et confort\r\nPOLYVALENT : roue en aluminium moulée sous pression avec solide revêtement en caoutchouc pour une utilisation sur toutes les surfaces\r\nLÉGER : entièrement en aluminium, le GWM 32 est particulièrement léger avec seulement 1,4 kg\r\nFOURNI AVEC : odomètre GWM 32 et housse de protection\r\nGrande qualité\r\nCompteur précis dans un boîtier en plastique résistant aux chocs\r\n', 51000, 1, 21, 109, '1.4KG', 0, '2023-10-08 22:09:56'),
(506, '5e9308365f036d712d9cb601ff36132f.webp', 'fcb7d9601f919698f3fb1ea8167b133a.', '87cea07b8f26b6fd1fdbe0a09a9749f8.', '35ca7ddf6d8ec727cc3c695b269131e4.', 'POLISSEUSE GPO14CE', 'Grande maniabilité, progression de travail rapide et très bons résultats\r\nManiement facile grâce à la poignée ergonomique avec revêtement softgrip et à la grande légèreté (seulement 2,5 kg)\r\nPuissant moteur de 1 400 W à démarrage progressif pour un usage intensif sur de grandes surfaces\r\nPrésélection de vitesse pour des résultats de polissage parfaits sur différents matériaux\r\n', 107000, 1, 21, 109, '2.5KG', 0, '2023-05-24 02:20:20'),
(507, 'ce5aba750b9067e0de10cdb5dc74d12a.webp', 'c86751da722d4352b6f9a4105308782f.', '870aad38fa4bdaa93824e66f216cd0d0.', '67ab2db574630982ed2de270a7b0730c.', 'PROJECTEUR CHANTIER SANS FIL', 'Le projecteur 18 V polyvalent de 1 900 lumens\r\nPuissante LED produisant jusqu’à 1 900 lumens pour un éclairement parfait\r\n2 niveaux de luminosité, 5 orientations possibles et filetage de trépied de 5/8&quot; pour une adaptation rapide à chaque situation de travail\r\nIdéal pour éclairer des espaces de travail complets pendant toute une journée\r\n', 105000, 1, 21, 109, '00', 0, '2023-05-24 02:25:42'),
(508, 'f7e14fd2b426169a08b9308c3f6410df.jpg', '6c51faf02d7d4455232f31b347e066af.', '0fae8fbd3837524e93ffe1c7dbf1e89f.', 'e85b0ae4b018639ae2e262c456654412.', 'RABOT 82MM-650W', 'Produit de qualité supérieure\r\nLe puissant moteur de 650 W offre une vitesse de planification rapide\r\nNouvelle conception du réglage de la profondeur de coupe maximale de 2,6 mm\r\nFlux d&#039;air optimisé pour l&#039;éjection des copeaux de bois', 70000, 1, 21, 109, '2.8KG', 0, '2023-05-24 02:30:14'),
(509, '44ef2c7618ba327ba475902fd6721388.jpg', '1756821ff8c854199e47194dfa898164.', '508295a45cfa8f775c9144e101ec810f.', '34feb8084156e0f7586a8bc826fab4b4.', 'SCIE CIRCULAIRE 1400W', 'La scie circulaire GKS 190 de Bosch Professional avec diamètre de lame de 190 mm\r\nGrande souplesse d’utilisation dans chaque situation grâce à la profondeur de coupe élevée (70 mm) et à la grande plage d’inclinaison (jusqu’à 56 degré)\r\nProgression de sciage rapide dans les bois tendres et durs grâce au puissant moteur de 1400 W. Régime à vide : 5500 tr/min\r\nForme ergonomique et compacte pour une bonne prise en main et maniabilité\r\n', 75000, 1, 21, 109, '25.4CM', 0, '2023-05-24 02:36:05'),
(510, 'a9bc995a8d7e508a2b86edaaefd6a56a.webp', '379ab4acd748cc3fdbf0a264b1760080.', '4157d58acb413e3013ce38ea65b9352b.', '4d47672789264e623cc6144d9b8817a3.', 'SCIE SAUTEUSE 650W', 'Respecte les standards de qualité Bosch\r\nÉconomique et endurante avec technologie Bosch performante pour d’excellents résultats\r\nCadence de coupe réglable en fonction du matériau ; molette de présélection de vitesse séparée pour un maniement facile\r\nDesign compact, faibles vibrations, poignée mince et grande légèreté pour une utilisation facilePuissance absorbée nominale\r\n450 W\r\nScie, longueur de course\r\n18 mm\r\nNombre de courses à vide\r\n800 – 3.100 courses/min\r\n', 118000, 1, 21, 109, '1.9KG', 0, '2023-05-24 02:43:05'),
(511, 'b105bf484f9cb34f1cd719b5a2d315e0.webp', 'e3df23079cf35ac419b646100a321714.', '3d51389e785efdfa2bffeac46c3090e2.', '42fbeeec70a83a909031e620f49917a4.', 'SOUFFLEUR 620W', 'Une puissance époustouflante dans sa catégorie\r\nRapport poids/performance idéal\r\nMeilleures performances de nettoyage de sa catégorie\r\nCharbons faciles à remplacer\r\n\r\nDonnées supplémentaires\r\nPuissance absorbée nominale\r\n620 W\r\nDébit volumétrique\r\n3,5 m³/min\r\nRégime à vide\r\n16 000 t/min\r\n', 38000, 1, 21, 109, '1.7KG', 0, '2023-05-24 02:56:28'),
