(608, 'c13183afe4a1136ee49a655c0259c39d.jpg', 'be191d22b0e2253927a88f8b35134c8e.', 'c2fcfa02f68e37e5e40b6649b953445b.', '306cd013709204f06b5b791f940ac285.', 'FER À BETON UNI N°5-7-9-11', 'L’acier est un alliage de fer et de carbone. Cet alliage possède une bonne résistance mécanique en traction et en compression. Le fer apporte une base de résistance importante et de la ductilité. Cela permet au matériau de se déformer notablement sans se rompre. C’est une propriété intéressante car cela permet de transformer la forme du matériau aisément.Cela lui donne aussi de bonnes capacités pour résister aux chocs en les encaissant. Le carbone accroît de façon considérable la résistance de l’acier. C’est essentiellement la teneur en carbone qui confère à l’alliage les propriétés du métal qu’on appelle « acier ».\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 53000, 1, 4, 122, '1TONNE', 0, '2023-10-15 11:49:11'),
